// src/App.js – FINAL + Detectare aplicație instalată pe mobil
import React, { useEffect, useState } from "react";
import {
  WalletKitProvider,
  ConnectButton,
  useWalletKit,
} from "@mysten/wallet-kit";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
  useNavigate,
  useLocation,
} from "react-router-dom";
import { getFullnodeUrl, SuiClient } from "@mysten/sui.js/client";
import {
  Tabs,
  Tab,
  Box,
  AppBar,
  Toolbar,
  Typography,
  Container,
  Select,
  MenuItem,
  useMediaQuery,
  useTheme,
  Grid,
  Button as MuiButton,
} from "@mui/material";
import {
  QueryClient,
  QueryClientProvider,
  useQuery,
} from "@tanstack/react-query";
import { client } from "./services/suiClient";
import ProtectedRoute from "./routes/ProtectedRoute";
import HomePage from "./pages/HomePage";
import Dashboard from "./pages/Dashboard";

// ---------- Sui Client ----------

const queryClient = new QueryClient();

// ---------- Routing ----------
function AppRoutes() {
  return (
    <Routes>
      <Route path="/" element={<HomePage />} />
      <Route
        path="/dashboard/*"
        element={
          <ProtectedRoute>
            <Container maxWidth={false} sx={{ mt: 3, px: { xs: 1, sm: 3 } }}>
              <Dashboard />
            </Container>
          </ProtectedRoute>
        }
      />
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
}

// ---------- Root ----------
export default function Root() {
  return (
    <QueryClientProvider client={queryClient}>
      <WalletKitProvider
        autoConnect={false}
        chains={["sui:devnet"]}
        enableMobileWallets={true} // Necesare pentru detectare
      >
        <Router>
          <AppRoutes />
        </Router>
      </WalletKitProvider>
    </QueryClientProvider>
  );
}
